sources.styles\\form.scss:
.form {
  width: $input-width;

  &--input {
    width: $input-width - $input-left-padding;
    height: $input-height;
    margin-bottom: 16px;
    padding-left: $input-left-padding;
    background: #f7f8ff;
    border: none;
    border-radius: $most-used-border-radius;
  }

  &--input:focus {
    outline-color: $blue-text-color;
  }

  &--input::placeholder {
    color: #b9c1ce;
    font-size: 14px;
    line-height: 14px;
  }

  &__textarea {
    height: 144px;
    padding-top: 17px;
    font-family: inherit;
    resize: none;
  }

  &__submit-button {
    width: $input-width;
    height: $input-height;
    margin-top: 16px;
    background: $blue-text-color;
    box-shadow: 0 6px 23px rgba(0, 117, 255, 0.46);
    border-radius: $most-used-border-radius;
    box-sizing: border-box;
    outline: none;
    border: none;
    color: $wite-color;
    line-height: 14px;
    font-weight: bold;
    cursor: pointer;
  }

  @media (max-width: $mobile-size-breackpoint) {
    margin-top: 30px;
  }

  @media (max-width: $half-breackpoint) {
    width: 100%;

    &--input {
      width: 100%;
      box-sizing: border-box;
    }

    &__submit-button {
      width: 100%;
    }
  }
}

