sources.styles\\person-card.scss:
.person-card {
  width: $person-card-width;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 10px 0;

  &__person-photo {
    width: 153px;
    height: 153px;
    margin-bottom: 28px;
    transition: $transfrom-duration;
    cursor: pointer;
  }

  &__person-photo:hover {
    transform: $transform-property;
  }

  &__person-name {
    font-weight: bold;
    font-size: 24px;
    line-height: 30px;
    color: $blue-text-color;
  }

  &__person-position {
    font-size: 14px;
    line-height: 27px;
    color: #9fadc2;
  }

  &__respond {
    margin-top: 13px;
    color: $main-text-color;
    text-align: center;
  }

  @media (max-width: $mobile-size-breackpoint) {
    width: $person-card-width-for-small-screen;
    margin-bottom: 30px;
  }
}

sources.styles\\contacts.scss:
.contacts {

  &__conteiner-for-contacts {
    display: grid;
    grid-template-columns: 1fr 1fr 2fr;

    @media (max-width:$mobile-size-breackpoint) {
      grid-template-columns: 1fr;
    }

